/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trn_trlogsheet_AFTER_UPDATE` AFTER UPDATE ON `trn_trlogsheet` FOR EACH ROW BEGIN
declare
varDie varchar(20);
declare
varComp	varchar(20);
declare
pksrl	varchar(30);
select txtDieNo  into varDie from trn_log_blank_cutting where pkTrnLogsheet=new.fk_trnbclogsheet;
select txtCompCode  into varComp from trn_log_blank_cutting where pkTrnLogsheet=new.fk_trnbclogsheet;
select concat(date_format(current_timestamp,'%y%m%d%h%m%s'),txtDieNo,txtCompCode) into pksrl from trn_log_blank_cutting where pkTrnLogsheet=new.fk_trnbclogsheet;
update trn_logsheet_operation 
set fk_trnbclogsheet=new.fk_trnbclogsheet,
txtOperationCode=new.txtOperationCode,
txtDieNo= varDie,
txtCompCode= varComp
where pkTRLogsheet=new.pkTRLogsheet;
if new.txtHTFlag ="Y" then
insert into trnheattreatment (pk_HeatTrtID, pkTRLogsheet, fk_trnbclogsheet,txtCompCode,txtDieNo) values (pksrl,new.pkTRLogsheet,new.fk_trnbclogsheet,varcomp,varDie);
end if;
END */;;
